import React from "react";
import './index.css'
import './components/layout/Card.css';
import './components/App.css';

import Pri from './components/Pri.jsx';
import Card from './components/layout/Card.jsx';
import Img from './components/img';
import Parametros from './components/Parametros';


export default (props) => (

    <div className="App">


    <Card titulo="Pokémon GO: como pegar Zekrom nas reides.">
        <Img />
      <Parametros /> 
      <Pri />
    </Card>


    <Card titulo="Pokémon GO: Mega Evolução é anunciada e chega ao jogo ainda em 2020">
        <Img />
        <Pri />
      <Parametros />
    </Card>

    <Card titulo="Chamado 'New Pokémon Snap', game coloca jogador em uma ilha para fotografar monstrinhos">
        <Img />
        <Pri />
      <Parametros />
    </Card>

  </div>
)
